import {useSelector} from 'react-redux'
import './changePswd.css'

const ChangePswd = () => {
    const authenticatedUser = useSelector(state => state.auth)
    const [changePassword, setChangePassword] = useState({
        oldPassword : "",
        newPassword : ""
    })

